Milo Boyd (Gerard Butler), een mislukte premiejager, krijgt zijn 
droombaan als hij wordt aangewezen om zijn ex-vrouw, verslaggeefster 
Nicole Hurly (Jennifer Aniston), op te sporen. Hij denkt dat het 
een gemakkelijke klus wordt, maar wanneer Nicole hem op een dwaalspoor 
brengt zodat zij achter een tip over een moord kan aangaan, beseft hij 
dat niets ooit eenvoudig gaat tussen Nicole en hem. De exen vliegen 
elkaar constant in de haren, totdat zij moeten rennen voor hun leven.
